         Sine(8)=TwoC*Sine(7)-Sine(6)
         Cosine(8)=TwoC*Cosine(7)-Cosine(6) 
         Sine(9)=TwoC*Sine(8)-Sine(7)
         Cosine(9)=TwoC*Cosine(8)-Cosine(7) 
         Sine(10)=TwoC*Sine(9)-Sine(8)
         Cosine(10)=TwoC*Cosine(9)-Cosine(8) 
         Sine(11)=TwoC*Sine(10)-Sine(9)
         Cosine(11)=TwoC*Cosine(10)-Cosine(9) 
         Sine(12)=TwoC*Sine(11)-Sine(10)
         Cosine(12)=TwoC*Cosine(11)-Cosine(10) 
         Sine(13)=TwoC*Sine(12)-Sine(11)
         Cosine(13)=TwoC*Cosine(12)-Cosine(11) 
