      SUBROUTINE IrRegular618(PQx,PQy,PQz,Cpq,Spq)
         IMPLICIT NONE
         REAL*8 Cpq(0:324),Spq(0:324),LegendreP(0:324)
         REAL*8 Sine(0:24),Cosine(0:24),CoFact(2:24)
